import "./tasks.css";

function Tasks(): JSX.Element {

    const [lists, setLists] = useState<ListModel[]>([]);


    useEffect(() => {
        listsService
            .getAllLists()
            .then(lists => setLists(lists))
            .catch(err => alert(err.message));
    }, []);


    return (
        <div className="tasks">
			<p>Tasks</p>
            {lists.map(l => <button  key={l._id}>{l.listName}</button>)}
        </div>
    );
}

export default Tasks;
